import React, {Component, Fragment} from 'react';
import {Container, Row, Col, Button} from 'react-bootstrap';  //npm install react-bootstrap bootstrap@5.1.3
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../../asset/css/style.css';
import Navberr from "../../component/nav_component/Nav";

class Topbanner extends Component{
  render(){
     return(
    <Fragment>
      <Navberr />
     <Container fluid={true} className='homeTopFixBanner p-0'>
       <div className='homeTopBannerOverlay'>
        
        <Container className="homeTopContent">
          <Row>
            <Col className='text-center'>
               <h1 className='homeTopTitle'>This Is My Home Banner Page</h1>
               <h2 className='homeTopSubTitle'>This is my Home Page ThankYou for Your Visite my Website.</h2>
               <Button variant="primary">More Info</Button>
            </Col>
          </Row>
        </Container>
       </div>
     </Container>
    </Fragment>
     )
  }
}
export default Topbanner;
